import './App.css';
import Button from '@mui/material/Button';

function App() {

  let hola = "hola";
  let como = "como";

  return (
    <div className="App">
      <Button variant="contained" onClick={(hola,como) => alert(hola + como + estas)}>Text</Button>
    </div>
  );
}

export default App;
